import PostCard from '../components/card/PostCard';
import Customer from '../components/Customer';
import { CustomerClass } from '../components/CustomerClass';
import JsonData from '../components/jsonData.json';

import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";
// import {Menu, Link} from "@material-ui/core";

function Home() {

    console.log(JsonData.PostCardList)

    return (
      <div className="App">
        <header className="App-header">
        <p>HOME</p>
        <PostCard 
            img={JsonData.PostCardList.img} 
            title={JsonData.PostCardList.title} 
            description={JsonData.PostCardList.description} 
            link={JsonData.PostCardList.link} 
            />
        <Customer name={'Tom'} age={22} title={'IT'}/>
        <CustomerClass name={'Tim'} age={23} title={'IT'}/>

        {/* <a
          className="App-link"
          href=""
          target="_blank"
          rel="noopener noreferrer"
        >
          HOME
        </a> */}

        {/* <Link to="/home"></Link> */}
        </header>
      </div>
    );
  }
  
  export default Home;
